import React from 'react';
import './App.css';
import Header from './components/HeaderDir/Header';
import MainGame from './components/MainGameDir/MainGame';
// import Sidebar from './components/SidebarDir/Sidebar';

function App() {
  return (
    <div className="App" style={{ background: `url(${'background1.webp'}) no-repeat center center fixed`, backgroundSize: 'cover' }}>
      <Header />
      <div className="maingame-container">
        <MainGame />
      </div>
    </div>
  );
}

export default App;
